using System.Collections.Generic;using UnityEditor;using System;public class Config_t_TravelRandom : AssetData{	public List<t_TravelRandom> asset = new List<t_TravelRandom>();	public void addContent(t_TravelRandom item)	{		asset.Add(item);	}	public static bool isloaded;	public static Dictionary<int, t_TravelRandom> _data { get; private set; }	public void init()	{		_data = new Dictionary<int, t_TravelRandom>();		for (int i = 0; i < asset.Count; i++){			_data.Add(asset[i].id, asset[i]);		}		asset = null;		isloaded = true;	}	public static t_TravelRandom getOne(int id)	{		if (_data.ContainsKey(id))			return _data[id];		else			throw new Exception("not find" + id);	}	public static void Dispose()	{		_data = null;	}}[Serializable]public class t_TravelRandom{	public int id;	public string sname;	public string describe;	public int spendTime;	public string special;	public string rareSpecial;}